import { Bars3Icon } from '@heroicons/react/24/solid';
import { useNavigate } from 'react-router-dom';

import { useState } from 'react';



export default function Header() {
    const [toggleMenu, setToggleMenu] = useState(false);

    const navigate = useNavigate();

    const navigateSkills = () => {
        navigate('/bulkmailoverview');
    };

    return (
        <header className="flex justify-between p-5 bg-primary text-white sticky top-0 z-50">
            <a href="#" className="font-bold">PORTFOLIO</a>
            <nav className="hidden md:block">
                <ul className="flex cursor-pointer">
                    <li><a href="../components/skill.js">Skills Acquired</a></li>
                    <button onClick={navigateSkills}></button>

                    <li><a href="#">My Projects</a></li>
                </ul>
            </nav>
            {toggleMenu && (
                <nav className="block md:hidden">
                    <ul className="flex flex-col mobile-nav cursor-pointer">
                        {/* <li><a href="../components/skill.js">Skills Acquired</a></li> */}
                        <button  onClick={navigateSkills} >Skills Acquired</button>
                        <li><a href="#">My Projects</a></li>
                    </ul>
                </nav>
            )}
            <button onClick={() => setToggleMenu(!toggleMenu)} className='block md:hidden'>
                <Bars3Icon className='text-white h-7' />
            </button>
        </header>
    );
}
